package ValidAnagram;
import java.util.HashMap;

class Solution {
  public boolean isAnagram(String s, String t) {

    if (s.length() != t.length())
      {
      return false;
      }
    HashMap<Character, Integer> hm_s = freqMap(s);
    HashMap<Character, Integer> hm_t = freqMap(t);

    for (char c : hm_t.keySet())
      {
      if ((!hm_s.containsKey(c)) || !hm_s.get(c).equals(hm_t.get(c)))
        {
        return false;
        }
      }
    return true;
  }

  HashMap<Character, Integer> freqMap(String str) {
    HashMap<Character, Integer> hm = new HashMap<>();
    for (int i = 0; i < str.length(); ++i)
      {
      char c = str.charAt(i);
      hm.put(c, (hm.getOrDefault(c, 0)) + 1);
      }
    return hm;
  }

  public static void main(String[] args) {
    Solution s = new Solution();
    String ss = "";
    String tt = "";
    boolean result = s.isAnagram(ss, tt);
    System.out.println(result);
  }
}